def BicycleChain(n,a,m,b):
	maxGear = 0
	cntMax = 0
	for x in b:
		for y in a:
			ratio = x/y
			if ratio.is_integer():
				if ratio>maxGear:
					cntMax = 1
					maxGear = ratio
				elif ratio==maxGear:
					cntMax+=1

	return cntMax

