    first = first_operation(x)
    second = second_operation(x)
 
    if(x > y):
        return False
    if(x == y):
        return True
 
    firstOp = transform(first,y,z)
 
    if(firstOp):
        z.append(first)
        return True
 
    else:
        secondOp = transform(second,y,z)
 
