def findS(maze, n, m):
  for i in range(n):
    for j in range(m):
      if maze[i][j] == 'S':
        return i, j

def f(maze, n, m, si, sj, dirs, path):
  i, j = si, sj
  for p in path:
    i += dirs[p][0]
    j += dirs[p][1]
    if not (0 <= i < n and 0 <= j < m):
      return False
    if maze[i][j] == 'E':
      return True
    if maze[i][j] == '#':
      return False
  return False

